VALUES ('3355570003393', 'Poulet Basilic Thaï, 350 Grammes, Marque Madern', 'Filet de poulet au basilic thaï (57%) : eau, filet de poulet origine France cuit (25%), poivrons rouges (9,7%), oignons, ciboule, basilic thaï (2,6%), huile de tournesol, sauce nuoc mam (POISSON), amidon transformé de maïs, ail, sucre, gingembre, concentré de tomates, caramel, fonds blanc de volaille [sirop de glucose, sel, farine de BLÉ, poule (graisse de poule, viande de poule), arôme, oignons, extraits de poireau et de CELERI, extraits de plantes aromatiques et d\'épices, antioxygènes (BHA, gallate de propyle)], citronnelle, curry (coriandre curcuma, MOUTARDE, farine de pois chiche, piment, fenugrec, poivre, ail, fenouil, cumin, sel). riz basmati cuit (96,5%), huile de tournesol, basilic thaï Riz basmati (43%) : (l , 3%), sel.', 'https://static.openfoodfacts.org/images/products/335/557/000/3393/front_fr.6.400.jpg', '3.3', '0.47', '16', '1.4', '1', '7.6', '0.578', '0.22755905511811', '', '1');

