VALUES ('3355570003447', 'Poulet Korma et Riz Basmati', 'Filet de poulet korma (57,2%): eau, filet de poulet origine France cuit (27,5%), yaourt (LAIT entier, LAIT écremé en poudre, ferments lactiques), crème fraîche [(crème de LAIT, protéines de Lait, stabilisant (carraghénanes)], oignons, huile de tournesol, ail, AMANDES effilées (1,3%), cumin, lait de coco (1 ,1%), coriandre, amidon transformé de maïs, sel, conçentré de tomates, noix de coco râpée, curcuma, sucre, coriandre feuille, cardamome, jus de citron [jus de citron, conservateur (DISSULFITE de potassium)], piment.  Riz basmati (42,8%): Riz basmati cuit (90,2%), oignons, huile de tournesol, raisins sec (2,3%) (raisins, huile végétale non hydrogénée), beurre (crème de LAIT, ferments lactiques}, ail, sel, cardamome.', 'https://static.openfoodfacts.org/images/products/335/557/000/3447/front_fr.8.400.jpg', '4.4', '1.88', '16', '1.7', '0.91', '7.3', '1.11', '0.437007874015748', '', '0');

